const Users = [
  {
    id: 1,
    email: 'user1@gmail.com',
    password: 'pass1',
    fname: 'USER1'
  },
  {
    id: 2,
    email: 'user2@gmail.com',
    password: 'pass2',
    fname: 'USER2'
  },
  {
    id: 3,
    email: 'user3@gmail.com',
    password: 'pass3',
    fname: 'USER3'
  },
];

export default Users;
